import React from "react";
import { NativeSelect, FormControl } from "@material-ui/core";
const Presentation = (props) => {
  const { countrys } = props;
  return (
    <div>
      <FormControl>
        <NativeSelect>
          <option value="global">Global</option>
          {}
        </NativeSelect>
      </FormControl>
    </div>
  );
};
export default Presentation;
